    public partial class Fallout4ModHeaderBinaryCreateTranslation
    {
        public readonly static Fallout4ModHeaderBinaryCreateTranslation Instance = new Fallout4ModHeaderBinaryCreateTranslation();

        public static void FillBinaryStructs(
            IFallout4ModHeader item,
            MutagenFrame frame)
        {
            item.Flags = EnumBinaryTranslation<Fallout4ModHeader.HeaderFlag>.Instance.Parse(frame: frame.SpawnWithLength(4));
            item.FormID = frame.ReadUInt32();
            item.Version = frame.ReadInt32();
            item.FormVersion = frame.ReadUInt16();
            item.Version2 = frame.ReadUInt16();
        }

        public static ParseResult FillBinaryRecordTypes(
            IFallout4ModHeader item,
            MutagenFrame frame,
            Dictionary<RecordType, int>? recordParseCount,
            RecordType nextRecordType,
            int contentLength,
            RecordTypeConverter? recordTypeConverter = null)
        {
            nextRecordType = recordTypeConverter.ConvertToStandard(nextRecordType);
            switch (nextRecordType.TypeInt)
            {
                case RecordTypeInts.HEDR:
                {
                    item.Stats = Mutagen.Bethesda.Fallout4.ModStats.CreateFromBinary(frame: frame);
                    return (int)Fallout4ModHeader_FieldIndex.Stats;
                }
                case RecordTypeInts.OFST:
                {
                    frame.Position += frame.MetaData.Constants.SubConstants.HeaderLength;
                    item.TypeOffsets = Mutagen.Bethesda.Binary.ByteArrayBinaryTranslation.Instance.Parse(frame: frame.SpawnWithLength(contentLength));
                    return (int)Fallout4ModHeader_FieldIndex.TypeOffsets;
                }
                case RecordTypeInts.DELE:
                {
                    frame.Position += frame.MetaData.Constants.SubConstants.HeaderLength;
                    item.Deleted = Mutagen.Bethesda.Binary.ByteArrayBinaryTranslation.Instance.Parse(frame: frame.SpawnWithLength(contentLength));
                    return (int)Fallout4ModHeader_FieldIndex.Deleted;
                }
                case RecordTypeInts.CNAM:
                {
                    frame.Position += frame.MetaData.Constants.SubConstants.HeaderLength;
                    item.Author = Mutagen.Bethesda.Binary.StringBinaryTranslation.Instance.Parse(
                        frame: frame.SpawnWithLength(contentLength),
                        stringBinaryType: StringBinaryType.NullTerminate);
                    return (int)Fallout4ModHeader_FieldIndex.Author;
                }
                case RecordTypeInts.SNAM:
                {
                    frame.Position += frame.MetaData.Constants.SubConstants.HeaderLength;
                    item.Description = Mutagen.Bethesda.Binary.StringBinaryTranslation.Instance.Parse(
                        frame: frame.SpawnWithLength(contentLength),
                        stringBinaryType: StringBinaryType.NullTerminate);
                    return (int)Fallout4ModHeader_FieldIndex.Description;
                }
                case RecordTypeInts.MAST:
                {
                    Fallout4ModHeaderBinaryCreateTranslation.FillBinaryMasterReferencesCustom(
                        frame: frame.SpawnWithLength(frame.MetaData.Constants.SubConstants.HeaderLength + contentLength),
                        item: item);
                    return (int)Fallout4ModHeader_FieldIndex.MasterReferences;
                }
                case RecordTypeInts.ONAM:
                case RecordTypeInts.XXXX:
                {
                    if (nextRecordType == RecordTypes.XXXX)
                    {
                        var overflowHeader = frame.ReadSubrecordFrame();
                        contentLength = checked((int)BinaryPrimitives.ReadUInt32LittleEndian(overflowHeader.Content));
                    }
                    frame.Position += frame.MetaData.Constants.SubConstants.HeaderLength;
                    item.OverriddenForms = 
                        Mutagen.Bethesda.Binary.ListBinaryTranslation<IFormLink<IFallout4MajorRecordGetter>>.Instance.Parse(
                            frame: frame.SpawnWithLength(contentLength),
                            transl: FormLinkBinaryTranslation.Instance.Parse)
                        .CastExtendedList<IFormLink<IFallout4MajorRecordGetter>>();
                    return (int)Fallout4ModHeader_FieldIndex.OverriddenForms;
                }
                case RecordTypeInts.INTV:
                {
                    frame.Position += frame.MetaData.Constants.SubConstants.HeaderLength;
                    item.INTV = frame.ReadInt32();
                    return (int)Fallout4ModHeader_FieldIndex.INTV;
                }
                case RecordTypeInts.INCC:
                {
                    frame.Position += frame.MetaData.Constants.SubConstants.HeaderLength;
                    item.INCC = frame.ReadInt32();
                    return (int)Fallout4ModHeader_FieldIndex.INCC;
                }
                default:
                    frame.Position += contentLength + frame.MetaData.Constants.SubConstants.HeaderLength;
                    return default(int?);
            }
        }

        static partial void FillBinaryMasterReferencesCustom(
            MutagenFrame frame,
            IFallout4ModHeader item);

